import React from 'react'
import '../Internal.css'
import { QuoteItems } from './QuoteItems'

const Quotes = () => {

    const QuoteOne = () => {
        return (
            <div className='quote-box'>
                <p className='quote-p'>
                    {QuoteItems[0].quote}
                </p>
                <p className='quote-author'>
                    {QuoteItems[0].author}
                </p>
            </div>
        )
    }

    const QuoteTwo = () => {
        return (
            <div className='quote-box'>
                <p className='quote-p'>
                    {QuoteItems[1].quote}
                </p>
                <p className='quote-author'>
                    {QuoteItems[1].author}
                </p>
            </div>
        )
    }

    const QuoteThree = () => {
        return (
            <div className='quote-box'>
                <p className='quote-p'>
                    {QuoteItems[2].quote}
                </p>
                <p className='quote-author'>
                    {QuoteItems[2].author}
                </p>
            </div>
        )
    }

    const QuoteFour = () => {
        return (
            <div className='quote-box'>
                <p className='quote-p'>
                    {QuoteItems[3].quote}
                </p>
                <p className='quote-author'>
                    {QuoteItems[3].author}
                </p>
            </div>
        )
    }
}

export default Quotes;
